import React, { Component } from 'react';
import axios from 'axios';

class Youtube extends Component {
  constructor() {
    super();
    this.state = {
      videoID: ''
    };
  }

  componentDidMount() {
    const url =
      'https://www.googleapis.com/youtube/v3/channels?part=snippet&id=UCNpffyr-7_zP1x1lS89ByaQ&key=AIzaSyAZ0yqg8AUruFVVgcjFCShQnWLJu7Tflco';
    axios.get(url).then(res => {
      console.log(res.data);
    });
  }
  render() {
    return <div>hi</div>;
  }
}

export default Youtube;
